CREATE DEFINER=`a6466e_asmotor`@`%` FUNCTION `GetUsernamesFromIDs`(`user_ids` VARCHAR(255)) RETURNS varchar(1024) CHARSET utf8 COLLATE utf8_unicode_ci
BEGIN
    DECLARE result VARCHAR(1024) DEFAULT '';
    DECLARE username VARCHAR(255);
    DECLARE done BOOLEAN DEFAULT FALSE;
    DECLARE cur CURSOR FOR SELECT staff_name FROM staff_creation WHERE FIND_IN_SET(staff_id, user_ids);
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    OPEN cur;
    read_loop: LOOP
        FETCH cur INTO username;
        IF done THEN
            LEAVE read_loop;
        END IF;
        IF LENGTH(result) > 0 THEN
            SET result = CONCAT(result, ', ');
        END IF;
        SET result = CONCAT(result, username);
    END LOOP;
    CLOSE cur;

    RETURN result;
END ;;
DELIMITER ;
