CREATE DEFINER=`a6466e_asmotor`@`%` PROCEDURE `InsertPermissionOrOnDuty`(IN `company_id` INT, IN `department_id` INT, IN `p_staff_id` INT, IN `staff_code` VARCHAR(255), IN `reporting` VARCHAR(255), IN `reason` VARCHAR(255), IN `permission_from_time` VARCHAR(255), IN `permission_to_time` VARCHAR(255), IN `permission_date` VARCHAR(255), IN `on_duty_place` VARCHAR(255), IN `leave_date` VARCHAR(255), IN `leave_todate` VARCHAR(255), IN `leave_reason` VARCHAR(255), IN `insert_login_id` INT, IN `responsible_staff` VARCHAR(255))
BEGIN

    DECLARE d_staff_name VARCHAR(255);
    DECLARE d_manager_name VARCHAR(255);
    DECLARE new_regularisation_id VARCHAR(255);
    Declare d_fcm_token VARCHAR(255);
    Declare d_responsible_staff_id INT;




    SELECT CONCAT('R-', COALESCE(MAX(CAST(SUBSTRING(regularisation_id, 3) AS SIGNED)), 0) + 1) INTO new_regularisation_id
FROM permission_or_on_duty;




SELECT staff_name INTO d_staff_name
    FROM staff_creation
    WHERE staff_id = p_staff_id
    Limit 1;

    SELECT staff_name INTO d_manager_name
    FROM staff_creation
    WHERE staff_id = reporting
    Limit 1;

    Select FCM_Token into d_fcm_token
    from user
    Where staff_id=reporting
    limit 1;

    Select staff_id into d_responsible_staff_id
    from staff_creation where staff_name=responsible_staff
    limit 1;





INSERT INTO permission_or_on_duty (
        regularisation_id,
        company_id,
        department_id,
        staff_id,
        staff_code,
        reporting,
        reason,
        permission_from_time,
        permission_to_time,
        permission_date,
        on_duty_place,
        leave_date,
        leave_to_date,
        leave_reason,
        staff_name,
        manager_name,
        insert_login_id,
        responsible_staff_name,
        responsible_staff
    )
    VALUES (
        new_regularisation_id,
        company_id,
        department_id,
        p_staff_id,
        staff_code,
        reporting,
        reason,
        permission_from_time,
        permission_to_time,
        permission_date,
        on_duty_place,
        leave_date,
        leave_todate,
        leave_reason,
        d_staff_name,
        d_manager_name,
        insert_login_id,responsible_staff,d_responsible_staff_id
    );

    Select d_staff_name as staff_name,d_manager_name as manager_name,new_regularisation_id as requestid,d_fcm_token as fcmtoken;
END ;;
DELIMITER ;
