CREATE DEFINER=`a6466e_asmotor`@`%` PROCEDURE `InsertProject`(IN `p_project_name` VARCHAR(255))
BEGIN
    DECLARE projectCount INT;


SELECT COUNT(*) INTO projectCount
    FROM project_creation
    WHERE project_name =  p_project_name;


IF projectCount > 0 THEN
        SELECT 'Project already exists' AS message;
    ELSE

INSERT INTO project_creation (project_name)
        VALUES (p_project_name);
        SELECT 'Project Created Successfully' AS message;
    END IF;
